import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
	padding: 8px;
	background-color: red;
	width: 100%;
	max-height: 100%;
	margin: 0 auto;
`;

const Register = () => {
	return;
	<Container>
		<LoginForm>
			<Title>
				<h1>Login</h1>
			</Title>
			<DataField>
				<label for='email'>Email </label>
				<input type='text' id='email' placeholder='email' />
			</DataField>
			<SendForm>
				<h3>Submit</h3>Submit
			</SendForm>
		</LoginForm>
	</Container>;
};

export default Register;
